[color=orange]Google Chrome is a browser that combines a minimal design with sophisticated technology to make the web faster, safer, and easier. Google Chrome also uses a brand new javascript engine (V8), which is much faster than existing javascript interpreters. This means you can create more complex and more intensive AJAX applications with fewer speed and processing constraints. Finally, Google Chrome is built on top of Blink (WebKit fork), so Google Chrome users will benefit from the CSS3 features being added to Blink (WebKit fork) as those features are released
